import { Component } from "react";
import DashboardHead from '../../layouts/Dashboard/DashboardHead';
import DashboardBody from '../../layouts/Dashboard/DashboardBody';
import Main from '../../layouts/Dashboard/Main';

class HomeView extends Component {

    constructor(props){
        super(props)

        this.state = {
            userDataLogin: null,
            userHistory: null
        }
    }

    componentDidMount(){
        this.userDataApi()
        this.userHistoryApi()
    }

    userHistoryApi(){
        const url = 'http://localhost:3000/api/user/info?type=history';
        fetch(url, {
            method: 'get',
            headers: {
                'Authorization': `Bearer ${this.props.token}`
            }
        }).then(res => res.json()).then(res => {
            this.setState({
                userHistory: res
            })
        })
    }

    userDataApi(){
        const url = 'http://localhost:3000/api/user/info?type=detail';
        fetch(url, {
            method: 'get',
            headers: {
                'Authorization': `Bearer ${this.props.token}`
            }
        }).then(res => res.json()).then(res => {
            this.setState({
                userDataLogin: res
            })
        })
    }

    toRpID(val){
        let	number_string = val.toString(),
        sisa 	= number_string.length % 3,
        rupiah 	= number_string.substr(0, sisa),
        ribuan 	= number_string.substr(sisa).match(/\d{3}/g);
            
        if (ribuan) {
            let separator = sisa ? '.' : '';
            rupiah += separator + ribuan.join('.');
        }

        return ribuan;
    }

    render(){
        return(
            <div>
                <Main>
                    <div className="col-lg-6 col-md-6 col-sm-6">
                    <div className="card card-stats">
                        <div className="card-header card-header-warning card-header-icon">
                        <div className="card-icon">
                            <i className="material-icons">apps</i>
                        </div>
                            <p className="card-category">Hello, {this.state.userDataLogin ? this.state.userDataLogin.name : null}</p>
                        <h3 className="card-title">
                            Transaksi: {this.state.userHistory.length}
                        </h3>
                        </div>
                        <div className="card-footer">
                        <div className="stats">
                            <i className="material-icons text-danger">warning</i>
                            <a href="#">Get More Space...</a>
                        </div>
                        </div>
                    </div>
                    </div>
                    <div className="col-lg-6 col-md-6 col-sm-6">
                    <div className="card card-stats">
                        <div className="card-header card-header-success card-header-icon">
                        <div className="card-icon">
                            <i className="material-icons">store</i>
                        </div>
                        <p className="card-category">Saldo anda</p>
                        <h3 className="card-title">Rp {this.state.userDataLogin ? this.toRpID(this.state.userDataLogin.saldo) : null}</h3>
                        </div>
                        <div className="card-footer">
                        <div className="stats">
                            <i className="material-icons">date_range</i> Last 24 Hours
                        </div>
                        </div>
                    </div>
                    </div>
                        
                <div className="col-sm-6">
                    <div className="card text-center">
                        <p>Produk</p>
                    <div className="card-body">
                        <table className="table">
                            <tbody>
                                <tr className="text-center" style={{fontSize: '14px'}}>
                                    <th >
                                        <a>
                                            <i className="material-icons text-danger" style={{fontSize: '2rem'}}>perm_phone_msg</i>
                                            <p>Pulsa</p>
                                        </a>
                                    </th>

                                    <th>
                                        <a>
                                            <i className="material-icons text-danger" style={{fontSize: '2rem'}}>important_devices</i>
                                            <p>Paket Data</p>
                                        </a>
                                    </th>
                                    <th>
                                        <a>
                                            <i className="material-icons text-danger" style={{fontSize: '2rem'}}>offline_bolt</i>
                                            <p>PLN</p>
                                        </a>
                                    </th>

                                    <th >
                                        <a>
                                            <i className="material-icons text-danger" style={{fontSize: '2rem'}}>facebook</i>
                                            <p>Social Media</p>
                                        </a>
                                    </th>
                                    
                                </tr>
                            </tbody>
                        </table>

                    </div>
                    </div>
                </div>
                <div className="col-lg-6">
                    <div className="card">
                    <div className="card-body">
                        <h4 className="card-title">Special title treatment</h4>
                        <p className="card-text">With supporting text below as a natural lead-in to additional content.</p>
                        <a href="#0" className="btn btn-primary">Go somewhere</a>
                    </div>
                    </div>
                </div>
                

                <div className="modal" tabindex="-1" role="dialog">
                <div className="modal-dialog" role="document">
                    <div className="modal-content">
                    <div className="modal-header">
                        <h5 className="modal-title">Modal title</h5>
                        <button type="button" className="close" data-dismiss="modal" aria-label="Close">
                        <span aria-hidden="true">&times;</span>
                        </button>
                    </div>
                    <div className="modal-body">
                        <p>Modal body text goes here.</p>
                    </div>
                    <div className="modal-footer">
                        <button type="button" className="btn btn-primary">Save changes</button>
                        <button type="button" className="btn btn-secondary" data-dismiss="modal">Close</button>
                    </div>
                    </div>
                </div>
                </div>


                </Main>
        </div>
        )
    }

}

export default HomeView;
